import React from 'react';
import './Member.css';

const defaultcharacter = {
  thumbnail_url: 'https://render.worldofwarcraft.com/us/character/malganis/130/235234178-avatar.jpg?alt=wow/static/images/2d/avatar/10-0.jpg',
  name:'Eremes',
  class:'Demon Hunter',
  spec: 'Havoc',
  score:'2500',
};

const Member = ({ character }) => {
  return (
    <div className="member">
      <img src={character.thumbnail_url} alt={`${character.name} thumbnail`} className="member-image" />
      <h3 className="member-name">{character.name}</h3>
      <p className="member-class">{character.class}</p>
      <p className="member-spec">{character.spec}</p>
      <p className="member-score">{character.score}</p>
    </div>
  );
};

export default Member;
